# parameters
min_time = dt.datetime(2016, 1, 25)
end_time = dt.datetime(2016, 2, 2)
nbr_of_teams = 10
teams_to_plot_journey = list(lb.groupby('TeamName').max()[['Score']].sort('Score', ascending=False).index[:8])
# predefined colors
team_colors = ['#000000', '#800000', '#FF0000', '#FFFF00', '#00FFFF', '#FF00FF', '#800080', '#0000FF']


# derive leaderboard ranks for each period
minutes = pd.date_range(min_time, end_time, freq='30Min')
surface = np.zeros([len(minutes), nbr_of_teams]) 
line = []
for i, m in enumerate(minutes):
    df = lb[lb.SubmissionDate <= m]
    x = df.groupby('TeamName').max()[['Score']]
    x = x.sort('Score', ascending=False)
    surface[i] = np.array(x)[:nbr_of_teams, 0]
    for team in teams_to_plot_journey:
        team_rank = list(x.index).index(team)
        team_score = x.irow(team_rank)['Score']
        line.append([i, team, team_rank, team_score])

line_df = pd.DataFrame(line, columns = ['time', 'team', 'rank', 'score'])
X, Y = np.meshgrid(np.arange(nbr_of_teams), np.arange(len(minutes)))

# Create the 3d suface plot
fig = plt.figure()
ax = fig.add_subplot(1, 1, 1, projection='3d')
surf = ax.plot_surface(X, Y, surface, rstride=1, cstride=1, cmap=plt.cm.Greens,
                       linewidth=0, antialiased=False, alpha=0.8)
fig.colorbar(surf, shrink=0.5, aspect=10)
for i, team in enumerate(teams_to_plot_journey):
    team_journey = line_df[line_df['team'] == team]
    team_journey = team_journey.sort('time')
    team_color = team_colors[i]
    team_final_rank = int(team_journey['rank'].values[-1])
    line, = ax.plot(team_journey['rank'].values, team_journey['time'].values, team_journey['score'].values, 
                    color=team_color, linewidth=2.5, label= '%i. %s' % (team_final_rank+1, team), alpha=0.8)

#Labeling & Legends
ax.set_xlabel('Rank')
ax.set_xticks(np.arange(nbr_of_teams))
ax.set_xticklabels(np.arange(nbr_of_teams) + 1)
ax.set_xlim(0, nbr_of_teams)

yt = np.arange(0, len(minutes), len(minutes)//10 )
yl = [minutes[t].strftime('%Y-%m-%d %H') for t in yt]
ax.set_yticks(yt)
ax.set_yticklabels(yl, ha='left')
ax.set_zlabel('AUC')

plt.legend(loc='upper left')
plt.title('Last week - Genentech - Cervical Cancer Screening')
plt.show()
fig.savefig('LastWeek.png', dpi=300)